import Button from 'react-bootstrap/Button';
import { useNavigate } from "react-router-dom";

const Home = () => {
    const navigate = useNavigate();
    
    const handleNavigate = () => {
      navigate('./pages/create');
    }

    return (  
      <div className='container w-50 p-5 text-center border border-warning bg-success p-2' style={{style:'--bs-bg-opacity: .5'}}>
          <h1>HOME PAGE</h1>
          <Button className='btn btn-success border border-dark border-2' onClick={handleNavigate}>CREATE</Button>         
      </div>
    );
}
 
export default Home;
